// Ajout d'un ellipsis sur les libelles du workflow
$(".mdg-workflow-text").dotdotdot({
	wrap : 'word'
});

$(function() {
	<!-- Dans le cas d'une vue de synthèse, ajout d'un champ comportant l'id de l'onglet qui est généré côté serveur.-->

	setTimeout(function() {
		// Remove Anti flickering - doit être fait le plus tôt possible  
		antiflickering.stop($('#mainContainer')).queue(function(){
				focus.setFocus();
				$(this).dequeue();
			}).delay(50).queue(function(){
			    // permet de libérer le thread pour rendre le dom plus rapidement et déclenché l'évènement 
			    // cgEvent.CONTAINER_VISIBLE que quand l'écran est bien visible.
			    setTimeout(function(){
					cgEvent.trigger($(window), cgEvent.CONTAINER_VISIBLE);
			    },0);
		    	$(this).dequeue();
		});
	},0);
});

